/**
 * adds node to the list
 * @param parentId
 * @param setData
 */
export const addNodeToList = (parentId: any, setData: any) => {
  const name = prompt("Enter name");

  const updateTree = (list: any) => {
    return list.map((node: any) => {
      if (node.id === parentId) {
        return {
          ...node,
          children: [
            ...node.children,
            {
              id: Date.now().toString(),
              name: name,
              isFolder: true,
              children: [],
            },
          ],
        };
      }
      if (node.children) {
        return { ...node, children: updateTree(node.children) };
      }
      return node;
    });
  };

  setData((prev: any) => updateTree(prev));
};

/**
 * deletes node from the list
 * @param itemId
 * @param setData
 */
export const deleteNodeFromList = (itemId: any, setData: any) => {
  const updateTree = (list: any) => {
    return list
      .filter((node: any) => node.id !== itemId)
      .map((node: any) => {
        if (node.children) {
          return { ...node, children: updateTree(node.children) };
        }
        return node;
      });
  };
  setData((prev: any) => updateTree(prev));
};

/**
 * edits current node
 * @param itemId
 * @param setData
 */
export const editNode = (itemId: any, setData: any) => {
  const name = prompt("Edit name");

  const updateTree = (list: any) => {
    return list.map((node: any) => {
      if (node.id === itemId) {
        node.name = name;
      }
      if (node.children) {
        return { ...node, children: updateTree(node.children) };
      }
      return node;
    });
  };
  setData((prev: any) => updateTree(prev));
};

